import ChatBot from "react-simple-chatbot";
import "./ChatBox.css";

function ChatBox() {
  return (
    <ChatBot
      steps={[
        {
          id: "greeting",
          message:
            "Oi, sou a DermaBot. Estou aqui para te ajudar.",
          trigger: "skin-type",
        },
        {
          id: "skin-type",
          message:
            "Voce diria que sua pele é oleosa ou seca?",
          trigger: "skin-type-options",
        },
        {
          id: "skin-type",
          options: [
            {
              value: 1,
              label: "Minha pele é oleosa",
              trigger: "oily",
            },
            {
              value: 2,
              label: "'Seca' descreve minha pele",
              trigger: "dry",
            },
            {
              value: 2,
              label: "Pele? Tenho isso nao",
              trigger: "no-skin",
            },
          ],
        },
        {
          id: "oily",
          message: "Ecaaa, cebosa!",
          trigger: "2",
        },
        {
          id: "seca",
          message: "Awesome! You are a telepath!",
          end: true,
        },
      ]}
    />
  );
}

export default ChatBox;
